import React from 'react';
import styled from 'styled-components';

const Container = styled.div`

    border-radius: 10px;
    box-shadow: 2px 2px 10px darkgray;
    height: 250px;
    width: 500px;
    margin: auto;
    margin-top: 100px;
`;

const CardImg = styled.img`

`;

const Card = () => {
    return (
        <Container >
            <CardImg src={CardList.img} />
        </Container>
  );
};

export default Card;
